(function ($, document) {

    //创建 DOM
    $.dom = function (str) {
        if (typeof(str) !== 'string') {
            if ((str instanceof Array) || (str[0] && str.length)) {
                return [].slice.call(str);
            } else {
                return [str];
            }
        }
        if (!$.__create_dom_div__) {
            $.__create_dom_div__ = document.createElement('div');
        }
        $.__create_dom_div__.innerHTML = str;
        return [].slice.call($.__create_dom_div__.childNodes);
    };

    var img_email = "data:image/png;base64,";
    var img_pengyouquan = "data:image/png;base64,";
    var img_qq = "data:image/png;base64,";
    var img_sms = "data:image/png;base64,";
    var img_weibo = "data:image/png;base64,";
    var img_weixin = "data:image/png;base64,";

    var panelBuffer = '<div class="mui-share">\
			<div class="mui-share-header">分享到</div>\
			<ul class="mui-share-body mui-table-view mui-grid-view mui-grid-9">\
			</ul>\
		</div>';

    //定义分享类
    var Share = $.Share = $.Class.extend({
        //构造函数
        init: function (options) {
            var self = this;
            self.options = options || {};
            self.options.message = options.message || {};
            self.options.excludeServices = options.excludeServices || ["tencentweibo"];
            self.options.extraServices = options.extraServices || [];
            self.panel = $.dom(panelBuffer)[0];
            document.body.appendChild(self.panel);
            self.body = self.panel.querySelector('.mui-share-body');
            self.mask = $.createMask();
            self.mask[0].addEventListener('tap', function () {
                self.hide();
            }, false);
            self._createShare();
            //防止滚动穿透
            self.panel.addEventListener('touchstart', function (event) {
                event.preventDefault();
            }, false);
            self.panel.addEventListener('touchmove', function (event) {
                event.preventDefault();
            }, false);
        },
        _createShare: function () {
            var self = this;
            var _services = [];
            //更新分享服务并创建服务对应的分享UI
            plus.share.getServices(function (_shareServices) {

                //额外添加的分享服务
                var shareServices = _shareServices.concat(self.options.extraServices);

                for (var i in shareServices) {
                    var shareService = shareServices[i];
                    var shareServiceId = shareService.id;
                    _services[shareServiceId] = shareService;
                    if (self.options.excludeServices.indexOf(shareServiceId) != -1) {
                        continue;
                    }
                    var _li = document.createElement("li");
                    _li.className = "mui-share-item mui-table-view-cell mui-media mui-col-xs-4";
                    _li.setAttribute("data-serviceid", shareServiceId);
                    if (shareServiceId == "weixin") {
                        _li.setAttribute("data-serviceextra", "WXSceneSession");
                    }

                    var _img = document.createElement("img");
                    //console.log(shareServiceId);
                    switch (shareServiceId) {
                        case "weixin":
                            _img.src = img_weixin;
                            break;
                        case "qq":
                            _img.src = img_qq;
                            break;
                        case "sinaweibo":
                            _img.src = img_weibo;
                            break;
                        case "sms":
                            _img.src = img_sms;
                            break;
                        case "email":
                            _img.src = img_email;
                            break;
                        default:
                            break;
                    }
                    _img.className = "mui-media-object";
                    var _div = document.createElement("div");
                    _div.innerHTML = shareService.description;
                    _div.className = "mui-media-body";
                    _li.appendChild(_img);
                    _li.appendChild(_div);
                    self.body.appendChild(_li);

                    if (shareServiceId == "weixin") {
                        var _liClone = _li.cloneNode(true);
                        _liClone.firstElementChild.src = "img/share_to_icon_pengyouquan.png";
                        _liClone.setAttribute("data-serviceextra", "WXSceneTimeline");
                        _liClone.lastElementChild.innerHTML = "朋友圈";
                        self.body.appendChild(_liClone);
                    }
                }

            }, function (exception) {
                console.log(JSON.stringify(exception));
            });

            mui(".mui-share-body").on("tap", "li", function (event) {
                var _self = this;
                var _serviceId = this.getAttribute("data-serviceid");
                var _service = _services[_serviceId];
                console.log(JSON.stringify(_serviceId));

                if (_serviceId == "sms") {
                    var _message = JSON.parse(JSON.stringify(self.options.message));
                    var msg = plus.messaging.createMessage(plus.messaging.TYPE_SMS);
                    msg.body = _message.title + "\n" + _message.href;
                    plus.messaging.sendMessage(msg, function () {
                        mui.toast("分享成功");
                    }, function () {
                        mui.toast("分享失败或取消");
                    });

                } else if (_serviceId == "email") {
                    var _message = JSON.parse(JSON.stringify(self.options.message));
                    var msg = plus.messaging.createMessage(plus.messaging.TYPE_EMAIL);
                    msg.subject = "来自河北省纪委监察厅的分享";
                    msg.body = _message.title + "\n" + _message.href;
                    plus.messaging.sendMessage(msg, function () {
                        mui.toast("分享成功");
                    }, function () {
                        mui.toast("分享失败或取消");
                    });
                } else {
                    _service.authorize(function () {
                        console.log(JSON.stringify(self.options.message));
                        var _message = JSON.parse(JSON.stringify(self.options.message));
                        if (_serviceId == "weixin") {
                            var _extra = _self.getAttribute("data-serviceextra");
                            _message.extra = {
                                scene: _extra
                            };
                        }
                        _service.send(_message, function () {
                            mui.toast("分享成功");
                        }, function (exception) {
                            console.log(JSON.stringify(exception));
                            if (exception.code == -100 || exception.code == -2) {
                                mui.toast(exception.message.split(",")[0]);
                            } else {
                                mui.toast("分享失败");
                            }
                        });
                    }, function (exception) {
                        console.log(JSON.stringify(exception));
                        mui.toast("分享组件授权失败");
                    });
                }

            });
        },
        //显示
        show: function (callback) {
            var self = this;
            self.callback = callback;
            self.mask.show();
            document.body.classList.add($.className('share-active-for-page'));
            self.panel.classList.add($.className('active'));
            self.panel.blur();
            //处理物理返回键
            self.__back = $.back;
            $.back = function () {
                self.hide();
            };
        },
        //隐藏
        hide: function () {
            var self = this;
            if (self.disposed) return;
            self.panel.classList.remove($.className('active'));
            self.mask.close();
            document.body.classList.remove($.className('share-active-for-page'));
            //处理物理返回键
            $.back = self.__back;
        },
        dispose: function () {
            var self = this;
            self.hide();
            setTimeout(function () {
                self.panel.parentNode.removeChild(self.panel);
                for (var name in self) {
                    self[name] = null;
                    delete self[name];
                }
                ;
                self.disposed = true;
            }, 300);
        }
    });

})(mui, document);